import React, { useEffect, useRef, useState } from 'react'
 import { StaticRouter as Router, Switch, Route } from 'react-router-dom';


import './App.scss';

import Navbar from '../src/components/NavHamburger/Navbar.components'
import Footer from '../src/components/Footer/Footer.components'


function App() {
   return (

     <Router > 
    <div className="App" >
            <Navbar />
            <h1>ghofrane</h1>
        <Footer/>
     </div>
     </Router>

  )
}

export default App
